def get_excel():
    wb = xlrd.open_workbook(r"query-hive-46287.xlsx")
    convert_list = []
    #通过索引获取表格
    sh = wb.sheet_by_index(0)
    # 获取表行数
    rows=sh.nrows
    # 获取表列数
    cols = sh.ncols
    for i in range(1,rows):
        row_content = []
        for j in range(cols):
            #ctype： 0,empty, 1,string, 2,number, 3,date, 4,boolean, 5,error
            ctype = sh.cell(i, j).ctype  # 表格的数据类型
            #print(sh.cell(i, j),ctype)
            cell = sh.cell_value(i, j)
            if ctype == 2 and cell % 1 == 0:  # 如果是整形
                cell = int(cell)
            elif ctype == 3:
                # 转成datetime对象
                date = datetime(*xldate_as_tuple(cell, 0))
                cell = date.strftime('%Y/%d/%m %H:%M:%S')
            elif ctype == 4:
                cell = True if cell == 1 else False
            row_content.append(cell)
        single = OrderedDict()
        single[row_content[1]] = row_content[5]
        convert_list.append(single)
    #print(convert_list)
    j = json.dumps(convert_list, ensure_ascii=False)
    excel = json.loads(j)

    single = {}
    for m in user_id:
        List = []
        for i in range(len(excel)):
            #print(excel[i])
            for v, k in excel[i].items():
                    if v == m:
                        List.append(excel[i][v])
                    else:
                        pass
            single["test_"+m] = List
    json1 = json.dumps(single, ensure_ascii=False)
    excel = json.loads(json1)
    compare(excel)

